CREATE DEFINER=`mms_pro`@`%` FUNCTION `selectMonth`(`i` INT) RETURNS varchar(1000) CHARSET utf8
begin
     declare StrMonth varchar(1000) default '';  -- default 是指定该变量的默认值
     declare currentIndex int default i;
 while currentIndex >= 0 DO -- 循环开始
 	if StrMonth <> '' THEN
	SET StrMonth = concat(StrMonth, ',', date_format(DATE_ADD(CURDATE(), INTERVAL currentIndex MONTH),'%Y-%m')); 
	else
	SET StrMonth = concat('',date_format(DATE_ADD(CURDATE(), INTERVAL currentIndex MONTH),'%Y-%m')); 
	end if;
	set currentIndex= currentIndex-1; 
 end while; -- 循环结束
 return StrMonth;
 end ;;
