CREATE DEFINER=`mms_pro`@`%` PROCEDURE `usp_Move_System_Log`(
in transferDate Date
)
begin 
	drop temporary table if exists temp_tb;
	-- 複製系統log資料到臨時表temp
	create temporary table temp_tb as (select *, now() as CREATED_DATE from mms_dev.ADM_SYSTEM_LOGGING where OPERATION_TIME < transferDate);
	
	-- 複製臨時表內容到系統log歷史表中
	INSERT INTO mms_dev.ADM_SYSTEM_LOGGING_HISTORY
	(LOG_ID, USER_ID, OPERATION_TIME, IP, LOG_CATEGRE, FUNCTION_NAME, CONTENT, `RESULT`, SESSION_ID, CLIENT_INFO, CREATED_DATE, USER_ACTION)
	SELECT 
		LOG_ID, USER_ID, OPERATION_TIME, IP, LOG_CATEGRE, FUNCTION_NAME, CONTENT, `RESULT`, SESSION_ID, CLIENT_INFO, CREATED_DATE, USER_ACTION
	FROM temp_tb;
  
	-- 刪除轉移時間前系統log
	DELETE FROM  mms_dev.ADM_SYSTEM_LOGGING WHERE OPERATION_TIME < transferDate;
end ;;
